import styles from './Home.module.css'


function Home(){
    return (
        <section className={styles.home_container}>
            <h1><span>Projeto_A3</span></h1>
            <p> Olá, Meu nome é Marlus Roberto e estou aqui para apresentar um pouco sobre minhas experiencias. </p>
            <p>Atualmente sou estudante de TI e estou fazendo este projeto para colocar em pratica os conhecimentos. </p>
            <p>. </p>


            
        </section>
    )
}

export default Home
